import React from 'react'

const BackNext = () => {
    return (
        <>
         
            <div className="btn-div">
                <button className="custom-btn btn-atras">Atras</button>
                <button className="custom-btn btn-siguiente">Siguiente</button>
            </div>

        </>
    )
}

export default BackNext
